import logo from './logo.svg';
import './App.css';
import { Route, Router } from 'react-router-dom';
import HomePage from './HomePage/HomePage';

function App() {
  return (
    <Router>
      <Route path='/' Component={HomePage}/>
    </Router>
  );
}

export default App;
